import React, {useState} from "react";
import axios from "axios";

function MostPopularProducts() {

    const [MostPopularArray, updateMostPopularArray] = useState([]);
    const [error, setError] = useState('');

    axios.get('http://localhost:8080/products')
        .then(res => {
            updateMostPopularArray(res.data);
        })
        .catch(err => {
            setError(err.message);
        });

    if(MostPopularArray != null) {
        return (
            <div className="container">

                <h1> Most popular </h1>

                <div className={"wrapper"}>
                    {MostPopularArray.map(product => (
                        <div className="box">
                            <div className="card">
                                <div className="imgBox">
                                    <p></p>
                                </div>
                                <div className="contentBox">
                                    <h3>{product.name1}</h3>
                                    <h2 className="price">{product.genre} </h2>
                                    <a href="#" className="buy">Details</a>
                                </div>
                            </div>
                        </div>)
                    )}
                </div>
            </div>
        );
    }
    else if(error != null){
        return (
            <div>
                <h3> Most popular </h3>
                <h3> Error: {error}</h3>
            </div>
        );
    }
    else {
        return (
            <div>
                <h3> Most popular </h3>
                <h1>Something went wrong!!!</h1>
            </div>
        );
    }
}

export default MostPopularProducts;
